"position"]="scale"},["serializer"]="chest",["modelBlockId"]="dungeonChest"},{["description"]="Cage made out of wood from the Dungeons",["encodeId"]=1305,["id"]="dungeonCageWood",["displayName"]="Wooden Dungeon Cage",["foundation"]=false,["scripts"]={},["viewport"]={["position"]="scale"},["craftingGui"]={["backgroundImage"]="rbxassetid://5673887945"},["health"]=8},{["description"]="Cage made out of metal from the Dungeons",["encodeId"]=1306,["id"]="dungeonCageMetal",["displayName"]="Metal Dungeon Cage",["foundation"]=false,["scripts"]={},["viewport"]={["position"]="scale"},["craftingGui"]={["backgroundImage"]="rbxassetid://5673887945"},["health"]=8},{["mural"]={["subject"]="Slime Dungeon Lore",["lore"]="The Primordial Slime, a force of nature, was the first slime to have existed. Its creator is unknown but it is considered to be the creator of all the other slimes that exist to this day."},["description"]="A mural depicting the Slime origins",["encodeId"]=1307,["id"]="slimeMural1",["displayName"]="Slime Mural 1",["foundation"]=false,["scripts"]={},["viewport"]={["position"]="scale"},["craftingGui"]={["backgroundImage"]="rbxassetid://5673887945"},["health"]=8,["placeOnWall"]=true},{["mural"]={["subject"]="Slime Dungeon Lore",["lore"]="The Primordialâ€™s first creations were the King and the Queen. It then proceeds to create other minor slime creatures, none as intelligent as his first."},["description"]="A mural depicting the Slime origins",["encodeId"]=1308,["id"]="slimeMural2",["displayName"]="Slime Mural 2",["foundation"]=false,["scripts"]={},["viewport"]={["position"]="scale"},["craftingGui"]={["backgroundImage"]="rbxassetid://5673887945"},["health"]=8,["placeOnWall"]=true},{["mural"]={["subject"]="Slime Dungeon Lore",["lore"]="The Primordial decides to crown its first creations, its favourites, to rule the rest of the slime population, creating a society."},["description"]="A mural depicting the Slime origins",["encodeId"]=1309,["id"]="slimeMural3",["displayName"]="Slime Mural 3",["foundation"]=false,["scripts"]={},["viewport"]={["position"]="scale"},["craftingGui"]={["backgroundImage"]="rbxassetid://5673887945"},["health"]=8,["placeOnWall"]=true},{["mural"]={["subject"]="Slime Dungeon Lore",["lore"]="The Primordial although a creator by nature is also chaotic. The destruction it caused disturbed the peace and growth of the newly formed Slime Kingdom."},["description"]="A mural depicting the Slime origins",["encodeId"]=1310,["id"]="slimeMural4",["displayName"]="Slime Mural 4",["foundation"]=false,["scripts"]={},["viewport"]={["position"]="scale"},["craftingGui"]={["backgroundImage"]="rbxassetid://5673887945"},["health"]=8,["placeOnWall"]=true},{["mural"]={["subject"]="Slime Dungeon Lore",["lore"]="In an attempt to save their civilization, the King and the Queen decided to trap Primordial in the dungeons where it can keep creating more slimes without disrupting the Slime Society."},["description"]="A mural depicting the Slime origins",["encodeId"]=1311,["id"]="slimeMural5",["displayName"]="Slime Mural 5",["foundation"]=false,["scripts"]={},["viewport"]={["position"]="scale"},["craftingGui"]={["backgroundImage"]="rbxassetid://5673887945"},["health"]=8,["placeOnWall"]=true},{["tradeLocked"]={},["mural"]={["subject"]="Slime Dungeon Lore",["lore"]="A long time ago, the Primordial Slime came into existence; the origins of its birth and its creator are all unknown. The Primordial, itself, is a creator and a destroyer. These two opposing qualities are baked into its DNA. It is known to have an untamed passion, leading to its behaviour extremes."},["description"]="A gold mural with extended info on the Slime origins",["encodeId"]=1312,["id"]="slimeMural1Gold",["displayName"]="Gold Slime Mural 1",["craftingGui"]={["backgroundImage"]="rbxassetid://5673887945"},["foundation"]=false,["scripts"]={},["viewport"]={["position"]="scale"},["placeOnWall"]=true,["health"]=8,["tradeConstraints"]={["verifiedTradeCooldowns"]={["maximum"]=100,["timeSpan"]={["totalSeconds"]=86400}},["tradeCooldowns"]={["maximum"]=10,["timeSpan"]={["totalSeconds"]=86400}},["maxPerTradeTransaction"]=10,["chestTrading"]=false}},{["tradeLocked"]={},["mural"]={["subject"]="Slime Dungeon Lore",["lore"]="The Primordialâ€™s first creations were two twin slimes, far more intelligent than itself and any other slimes he continued to create later. During the boom of the Slime Kingdom, the island started trading with the humans. The relationship between the slimes and humans was initially friendly and brought technological advancement to the slime society."},["description"]="A gold mural with extended info on the Slime origins",["encodeId"]=1313,["id"]="slimeMural2Gold",["displayName"]="Gold Slime Mural 2",["craftingGui"]={["backgroundImage"]="rbxassetid://5673887945"},["foundation"]=false,["scripts"]={},["viewport"]={["position"]="scale"},["placeOnWall"]=true,["health"]=8,["tradeConstraints"]={["verifiedTradeCooldowns"]={["maximum"]=100,["timeSpan"]={["totalSeconds"]=86400}},["tradeCooldowns"]={["maximum"]=10,["timeSpan"]={["totalSeconds"]=86400}},["maxPerTradeTransaction"]=10,["chestTrading"]=false}},{["tradeLocked"]={},["mural"]={["subject"]="Slime Dungeon Lore",["lore"]="Over time, the Slime Kingdom expanded, and the Primordial felt the need to appoint a leader to guide the society further. It crowned its favourite twins, King and Queen, because they were clever enough to assume the positions. The relationship between the slimes and humans started to sour because the humans considered themselves superior to the slimes. Therefore, as their first decree as Royals, the twins decided to outlaw humans from the Slime Kingdom."},["description"]="A gold mural with extended info on the Slime origins",["encodeId"]=1314,["id"]="slimeMural3Gold",["displayName"]="Gold Slime Mural 3",["craftingGui"]={["backgroundImage"]="rbxassetid://5673887945"},["foundation"]=false,["scripts"]={},["viewport"]={["position"]="scale"},["placeOnWall"]=true,["health"]